    <div>
    <p class=MsoNormal><span style='font-size:18.0pt;line-height:115%'>El voleibol
    fue inventado en 1895 por William G. Morgan, un instructor de educación
    física estadounidense. Morgan creó el juego combinando elementos de
    baloncesto, tenis y balonmano. El objetivo era crear un deporte que fuera
    menos intenso que el baloncesto, pero que aun así fuera divertido y
    desafiante.<o:p></o:p></span></p>
